Tyler and Gianna have an on and off again relationship.

Every time he sees her he is consumed with lust, he wants a lasting relationship but she just won't commit.

They decided to spend the night together as friends, but when he sees her getting dressed while he is bathing he can not contain himself and they have one last 'morning tryst'.

Watch their passion in HD as he enjoys her beautiful face and body one last time - right there on the bathroom floor.

Gianna is a gorgeous girl with many choices of men, so we understand why she won't commit. But fortunately for Tyler he has lots of options as well.

Watch this awesome HD video and see if you think they should give it one more try. XOXO ~ Colette
